INSERT INTO `v1_c9b2c9d69ebcad7f483791d4df51b0de614b2e4c37b3ad951ae702bde064cf64` VALUES ("馬鹿を言うんじゃあない後輩たち。\nこうも膳立てされて食わぬ腹があるか。\n君らの気持ち、しかと受け止めてやる。\n端的に換言すれば、ぼくをハブるな。", 10, 111011, 37914, 1, 0.5, 1, 37914068, 11, 0, 0);
